                <div class="stl_01" style="top: 0.5991em; left:14.0917em;"><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">三菱 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">PLC</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">以太网连接的 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">IP</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">地址设定 &nbsp;</span></div>
                <div class="stl_01" style="top: 3.3271em; left:7.502em;"><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0261em;">三菱 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0261em;">PLC</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0261em;">与 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0261em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0261em;">通过以太网连接时，必须通过 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0261em;">GX Developer</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0261em;">软件设置成与 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0261em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0261em;">同网段的 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0261em;">IP &nbsp;</span></div>
                <div class="stl_01" style="top: 4.8171em; left:5.752em;"><span class="stl_11 stl_12 stl_15">地址。 &nbsp;</span></div>
                <div class="stl_01" style="top: 6.8171em; left:7.502em;"><span class="stl_11 stl_12 stl_16">在设置之前要确保要进行设置的</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0195em;">&nbsp;</span><span class="stl_14 stl_12 stl_16" style="word-spacing:-0.0195em;">PLC</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0195em;">处于运行状态，</span><span class="stl_11 stl_12 stl_16" style="word-spacing:0.2075em;">&nbsp;让</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0197em;">&nbsp;</span><span class="stl_14 stl_12 stl_16" style="word-spacing:-0.0197em;">PLC</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0197em;">通过</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0197em;">&nbsp;</span><span class="stl_14 stl_12 stl_16" style="word-spacing:-0.0197em;">USB</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0197em;">与电脑连接，设置步 &nbsp;</span></div>
                <div class="stl_01" style="top: 8.3088em; left:5.752em;"><span class="stl_11 stl_12 stl_17">骤如下： &nbsp;</span></div>
                <div class="stl_01" style="top: 10.3088em; left:7.502em;"><span class="stl_11 stl_12 stl_18" style="word-spacing:-0.0218em;">＊第一步：电脑与 </span><span class="stl_14 stl_12 stl_18" style="word-spacing:-0.0218em;">PLC</span><span class="stl_11 stl_12 stl_18" style="word-spacing:-0.0218em;">连接成功后，打开 </span><span class="stl_14 stl_12 stl_18" style="word-spacing:-0.0218em;">GX Developer</span><span class="stl_11 stl_12 stl_18" style="word-spacing:-0.0218em;">软件，新建一个工程。 &nbsp;</span></div>
                <div class="stl_01" style="top: 25.7113em; left:7.482em;"><span class="stl_11 stl_12 stl_19">※第二步：点击“参数”下树形图。然后双击“网络参数”</span><span class="stl_14 stl_12 stl_19">,</span><span class="stl_11 stl_12 stl_19">在左上角跳出的对话框中再点 &nbsp;</span></div>
                <div class="stl_01" style="top: 27.0113em; left:5.732em;z-index:223; "><span class="stl_11 stl_12 stl_15">击</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_20">。“</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.239em;">&nbsp;</span><span class="stl_11 stl_12 stl_21" style="word-spacing:-0.0055em;">以太网</span><span class="stl_14 stl_12 stl_21" style="word-spacing:-0.0055em;">/CC IE/MELSECNET</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_22">”。 &nbsp;</span></div>
                <div class="stl_01" style="top: 48.8129em; left:7.482em;"><span class="stl_11 stl_12 stl_23">※第三步：在跳出的表格中，网络类型选择“以太网”；模式选择“在线”，然后点击“操 &nbsp;</span></div>
                <div class="stl_01" style="top: 50.1129em; left:5.732em;"><span class="stl_11 stl_12 stl_17">作设置” &nbsp;</span></div>
