                <div class="stl_01" style="top: 0.1371em; left:7.482em;"><span class="stl_11 stl_12 stl_15">※</span></div>
                <div class="stl_01" style="top: 0.1371em; left:8.382em;"><span class="stl_11 stl_12 stl_24">第四步：在跳出的</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.2436em;">&nbsp;</span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.2436em;">IP</span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.0206em;">&nbsp;</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0206em;">地址设定的对话框中设定</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.2427em;">&nbsp;</span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.2427em;">IP</span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.0092em;">&nbsp;</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0092em;">地址，由于</span><span class="stl_11 stl_12 stl_24" style="word-spacing:0.2408em;">&nbsp;</span><span class="stl_14 stl_12 stl_24" style="word-spacing:0.2408em;">SS700</span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.0099em;">&nbsp;</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0099em;">的默认网关为 &nbsp;</span></div>
                <div class="stl_01" style="top: 1.4371em; left:5.732em;"><span class="stl_14 stl_12 stl_25">192.168.200.1</span><span class="stl_11 stl_12 stl_25">，小编把该</span><span class="stl_11 stl_12 stl_25" style="word-spacing:0.1012em;">&nbsp;</span><span class="stl_14 stl_12 stl_25" style="word-spacing:0.1012em;">PLC</span><span class="stl_14 stl_12 stl_25" style="word-spacing:-0.163em;">&nbsp;</span><span class="stl_11 stl_12 stl_25" style="word-spacing:-0.163em;">的</span><span class="stl_11 stl_12 stl_25" style="word-spacing:0.0983em;">&nbsp;</span><span class="stl_14 stl_12 stl_25" style="word-spacing:0.0983em;">IP</span><span class="stl_14 stl_12 stl_25" style="word-spacing:-0.163em;">&nbsp;</span><span class="stl_11 stl_12 stl_25" style="word-spacing:-0.163em;">地址设为：</span><span class="stl_14 stl_12 stl_25" style="word-spacing:-0.163em;">192.168.200.10</span><span class="stl_11 stl_12 stl_25" style="word-spacing:-0.163em;">，勾选“运行中允许写入”， &nbsp;</span></div>
                <div class="stl_01" style="top: 2.7371em; left:5.732em;"><span class="stl_11 stl_12 stl_26">最后点击“结束设置”。 &nbsp;</span></div>
                <div class="stl_01" style="top: 4.6619em; left:7.482em;"><span class="stl_27 stl_12 stl_28" style="font-weight:bold;">其他设置选择如下： &nbsp;</span></div>
                <div class="stl_01" style="top: 6.4619em; left:7.482em;"><span class="stl_27 stl_12 stl_29">通信数据格式设置：</span><span class="stl_30 stl_12 stl_29">2</span><span class="stl_27 stl_12 stl_29">进制码 &nbsp;</span></div>
                <div class="stl_01" style="top: 8.2636em; left:7.482em;"><span class="stl_27 stl_12 stl_31">初始时间设置：始终等待打开（停止时可以通讯） &nbsp;</span></div>
                <div class="stl_01" style="top: 10.0636em; left:7.482em;"><span class="stl_27 stl_12 stl_32">发信结构设置：以太网（</span><span class="stl_30 stl_12 stl_32">V2.0</span><span class="stl_27 stl_12 stl_32">） &nbsp;</span></div>
                <div class="stl_01" style="top: 11.8636em; left:7.482em;"><span class="stl_30 stl_12 stl_33" style="word-spacing:-0.0276em;">TCP</span><span class="stl_27 stl_12 stl_33" style="word-spacing:-0.0276em;">生存确认设置：使用 </span><span class="stl_30 stl_12 stl_33" style="word-spacing:-0.0276em;">KeepAlive &nbsp;</span></div>
                <div class="stl_01" style="top: 30.9413em; left:7.482em;"><span class="stl_11 stl_12 stl_34">※第五步：回到第三步跳出的表格中，输入正确的起始</span><span class="stl_11 stl_12 stl_34" style="word-spacing:0.1935em;">&nbsp;</span><span class="stl_14 stl_12 stl_34" style="word-spacing:0.1935em;">I/O</span><span class="stl_14 stl_12 stl_34" style="word-spacing:-0.07em;">&nbsp;</span><span class="stl_11 stl_12 stl_34" style="word-spacing:-0.07em;">号、网络号、站号等信息，最 &nbsp;</span></div>
                <div class="stl_01" style="top: 32.2413em; left:5.732em;"><span class="stl_11 stl_12 stl_35">后点击“结束设置”。 &nbsp;</span></div>
                <div class="stl_01" style="top: 48.8429em; left:7.482em;"><span class="stl_11 stl_12 stl_36" style="word-spacing:0.1601em;">※第六步：点击上方菜单的“在线</span><span class="stl_14 stl_12 stl_36" style="word-spacing:0.1601em;">&gt;PLC</span><span class="stl_11 stl_12 stl_36" style="word-spacing:0.1601em;">写入”，在 跳出的对话框中，选择所有点击“执行”， &nbsp;</span></div>
                <div class="stl_01" style="top: 50.1429em; left:5.732em;z-index:300; "><span class="stl_11 stl_12 stl_37">然后按相应的“全部是</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_38">”、</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.2507em;">&nbsp;</span><span class="stl_11 stl_12 stl_39">“是”、“确定”直至写入完成，最后关闭。 &nbsp;</span></div>
