                <div class="stl_01" style="top: 0.1371em; left:7.482em;"><span class="stl_11 stl_12 stl_39">※第七步：</span><span class="stl_14 stl_12 stl_39">PLC</span><span class="stl_14 stl_12 stl_39" style="word-spacing:-0.0706em;">&nbsp;</span><span class="stl_11 stl_12 stl_39" style="word-spacing:-0.0706em;">断电重启，</span><span class="stl_11 stl_12 stl_39" style="word-spacing:0.2614em;">&nbsp;</span><span class="stl_14 stl_12 stl_39" style="word-spacing:0.2614em;">IP</span><span class="stl_14 stl_12 stl_39" style="word-spacing:-0.0706em;">&nbsp;</span><span class="stl_11 stl_12 stl_39" style="word-spacing:-0.0706em;">地址修改成功。此时可以点击上方菜单的“诊断</span><span class="stl_14 stl_12 stl_39" style="word-spacing:-0.0706em;">&gt;</span><span class="stl_11 stl_12 stl_39" style="word-spacing:-0.0706em;">以太网诊 &nbsp;</span></div>
                <div class="stl_01" style="top: 1.4371em; left:5.732em;"><span class="stl_11 stl_12 stl_40">断”，在跳出的对话框中确认是否修改成功。 &nbsp;</span></div>
                <div class="stl_01" style="top: 23.3661em; left:7.482em;"><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">注：如果不修改三菱 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">PLC</span><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">的 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">IP</span><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">地址，也可以对 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">SS700</span><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">的网关进行修改，使连接的 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">SS700</span><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">与 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">PLC</span><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">保持同一个 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">IP</span><span class="stl_27 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">段。进行 </span><span class="stl_30 stl_12 stl_41" style="font-weight:bold; word-spacing:-0.0604em;">SS700 &nbsp;</span></div>
                <div class="stl_01" style="top: 24.6661em; left:5.732em;z-index:180; "><span class="stl_27 stl_12 stl_42" style="font-weight:bold; word-spacing:-0.0285em;">的网关修改时，网络连接 </span><span class="stl_30 stl_12 stl_42" style="font-weight:bold; word-spacing:-0.0285em;">SS700</span><span class="stl_27 stl_12 stl_42" style="font-weight:bold; word-spacing:-0.0285em;">后通过浏览器访问：</span><span class="stl_30 stl_12 stl_42" style="font-weight:bold; word-spacing:-0.0285em;">192.168.200.1</span><span class="stl_27 stl_12 stl_42" style="font-weight:bold; word-spacing:-0.0285em;">进入“智能远程模块管理后台</span><span class="stl_27 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_27 stl_12 stl_43" style="font-weight:bold;">”，</span><span class="stl_27 stl_12 stl_15" style="word-spacing:0.258em;">&nbsp;</span><span class="stl_27 stl_12 stl_44" style="font-weight:bold;">点击“内网配置”进行修改。 &nbsp;</span></div>
